const router = createBrowserRouter([
    {
        path: '/',
        element: <HomePage/> // compmonent that should be rendered
    },
    {
        path: '/products',
        element: <ProductsPage/>
    }
]);

function App () {
    return <RouterProvider router={router}/>;
}

export default App;
